import { Box, Container, styled, Typography } from "@mui/material";

const ContainerFeed = styled(Box)(({ theme }) => ({
    backgroundColor: 'yellow',
    position: "fixed",
    height: '100%',
    overflow: 'scroll'
}));

const Feed = () => {
    return (
        <ContainerFeed>
            <Typography variant="h3"> Feed </Typography>
        </ContainerFeed>
    );
};

export default Feed;
